import pingpong from "../../../assets/images/pingpong.WEBP";
import cercleCarrer from "../../../assets/images/cercleCarrer.png";
import cuillere from "../../../assets/images/cuillere.png";
import oeil from "../../../assets/images/oeil.png";
import main from "../../../assets/images/main.png";
import train from "../../../assets/images/trains.png";

const alt=[
            "représente une raquette blanche.",
            "représente des symboles blancs.",
            "représente trois ronds blancs et une petite feuille blanche.",
            "représente deux yeux blancs et une oreile blanche.",
            "représente cinq ronds blancs relié par un fils blanc le tout formant un cercle.",
            "représente une locomotive blanche."
        ];

const srcImg=[pingpong,cercleCarrer,cuillere,oeil,main,train];

const tabImg={
    alt:alt,
    srcImg:srcImg
}

export default tabImg;
